  `to_qty_ea_op` decimal(18, 2) NULL DEFAULT NULL COMMENT '目标操作数量EA（增量）',
  `to_qty_ea_before` decimal(18, 2) NULL DEFAULT NULL COMMENT '目标操作前 库存数',
  `to_qty_ea_after` decimal(18, 2) NULL DEFAULT NULL COMMENT '目标操作后 库存数',
