  `org_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '平台Id',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unique_wm_tran`(`tran_id`, `org_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '库存交易表' ROW_FORMAT = DYNAMIC;

