  `weight_inv` decimal(10, 0) NULL DEFAULT NULL COMMENT '库存重量',
  `seq` int NULL DEFAULT NULL COMMENT '序号',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `index_lot_num`(`lot_num`, `org_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '业务库存表' ROW_FORMAT = DYNAMIC;

